MongoDB: Aggregating multidimensional info into a panel data<p>I am a beginner in MongoDB and I am learning aggregations. I have the following document which is information from Inflation, it looks like this:</p>
<pre><code>{
    &quot;_id&quot;: {
        &quot;$oid&quot;: &quot;60678f561091100d5dbe2ddf&quot;
    },

    &quot;V&quot;: 0.21,
    &quot;D1C&quot;: &quot;202001&quot;,    
    &quot;D2C&quot;: 63,    
    &quot;D3C&quot;: 7169,

},
{
    &quot;_id&quot;: {
        &quot;$oid&quot;: &quot;60678f561091100d5dbe2de0&quot;
    },    
    &quot;V&quot;: 0.39,
    &quot;D1C&quot;: &quot;202001&quot;,    
    &quot;D2C&quot;: 63,    
    &quot;D3C&quot;: 7170,

},
{
    &quot;_id&quot;: {
        &quot;$oid&quot;: &quot;60678f561091100d5dbe2de1&quot;
    },    
    &quot;V&quot;: 0.2,
    &quot;D1C&quot;: &quot;202001&quot;,    
    &quot;D2C&quot;: 63,    
    &quot;D3C&quot;: 7171,

},

(...)

{
    &quot;_id&quot;: {
        &quot;$oid&quot;: &quot;60678f561091100d5dbe2fa8&quot;
    },    
    &quot;V&quot;: 0.21,
    &quot;D1C&quot;: &quot;202001&quot;, 
    &quot;D2C&quot;: 69,    
    &quot;D3C&quot;: 7169,

},
{
    &quot;_id&quot;: {
        &quot;$oid&quot;: &quot;60678f561091100d5dbe2fa9&quot;
    }
    &quot;V&quot;: 0.39,
    &quot;D1C&quot;: &quot;202001&quot;,
    &quot;D2C&quot;: 69,
    &quot;D3C&quot;: 7170,
}
</code></pre>
