In Mongoose Model.find() and Model.find().exec() produce the same result. So why bother using Model.find().exec()?<p>I noticed that <code>Model.find()</code> seems to produce the same outcome as <code>Model.find().exec()</code>.  Both seem to retrieve the appropriate record/document as illustrated in the following two snippets of code:</p>
<pre><code>//without exec
export const getUser = async (req, res, next) =&gt; {
    try{
        let mongoDocument = await User.find({name: &quot;OrphanAnnie&quot;})
        res.status(200).json(mongoDocument);  
    } catch (err) {
        console.log(err) 
    }
}

//with exec
export const getUser = async (req, res, next) =&gt; {
    try{
        let mongoDocument = await User.find({name: &quot;OrphanAnnie&quot;}).exec()
        res.status(200).json(mongoDocument);  
    } catch (err) {
        console.log(err) 
    }
}
</code></pre>
<p>Which is the recommended approach? In <a href="https://stackoverflow.com/questions/31549857/mongoose-what-does-the-exec-function-do">Mongoose - What does the exec function do?</a> the post suggests that with <code>exec()</code> a Mongoose query can be built without using callback syntax.  But since the query seems to work without using <code>exec()</code> at all why bother using it?</p>

