Pulling from an array in a Mongo document by date<p>I'm trying to pull from an array in a mongo document using a value by comparing an isodate string older than 60 days using a mongo query, but it is not pulling the data from the array in the document. For example the document below should only have job 3 remaining in logs array after the query runs, but all three are remaining currently.</p>
<p>document</p>
<pre><code>{
    &quot;_id&quot; : &quot;0jYHGDtEIaE3BCjBW&quot;,
    &quot;owner&quot; : &quot;a&quot;,
    &quot;logs&quot; : [ 
        {
            &quot;job&quot; : &quot;1&quot;,
            &quot;createdAt&quot; : &quot;2020-01-31T05:07:09.468Z&quot;
        }, 
        {
            &quot;job&quot; : &quot;2&quot;,
            &quot;createdAt&quot; : &quot;2020-01-31T05:07:11.119Z&quot;
        },
        {
            &quot;job&quot; : &quot;3&quot;,
            &quot;createdAt&quot; : &quot;2021-04-01T05:07:11.119Z&quot;
        }
    ]
}
</code></pre>
<p>code</p>
<pre><code>let deleteDate = new Date(Date.now() - 60 * 24 * 60 * 60 * 1000);
    Logs.update(
      {},
      {
        $pull: {
          logs: {
            createdAt: {
              $gte: deleteDate,
            },
          },
        },
      },
      { multi: true }
    );
</code></pre>
<p>expected result</p>
<pre><code>{
    &quot;_id&quot; : &quot;0jYHGDtEIaE3BCjBW&quot;,
    &quot;owner&quot; : &quot;a&quot;,
    &quot;logs&quot; : [
        {
            &quot;job&quot; : &quot;3&quot;,
            &quot;createdAt&quot; : &quot;2021-04-01T05:07:11.119Z&quot;
        }
      ]
}
</code></pre>

