How to get a date to the end of week in MongoDB?<p>I have a field called <code>delDate</code> and I want to use <code>project</code> to get the end of the week which is next Saturday and I want to use the end of week to group the <code>revenue</code>/ How do I do this in MongoDB?</p>
<pre><code>weekEnd: {
  $subtract: [{
    $dateFromParts: {
      &quot;year&quot;: { $year: &quot;$$NOW&quot; },
      &quot;month&quot;: { $month: &quot;$$NOW&quot; },
      &quot;week&quot;: { $add: [{ $week: &quot;$$NOW&quot; }, 1] },
    }
  }, 86400000]
}
</code></pre>

